import React, { useState } from "react";

export default function App() {
  const [resumeText, setResumeText] = useState("");

  const handleFile = (file) => {
    if (!file || file.type !== "text/plain") {
      window.alert("Please upload a .txt resume file.");
      return;
    }
    const reader = new FileReader();
    reader.onload = (e) => setResumeText(e.target.result);
    reader.readAsText(file);
  };

  const handleDrop = (e) => {
    e.preventDefault();
    handleFile(e.dataTransfer.files[0]);
  };

  const downloadPDF = () => {
    if (!resumeText.trim()) {
      window.alert("Upload a resume first.");
      return;
    }
    const win = window.open("", "_blank");
    win.document.write(`
      <html>
        <head>
          <title>Resume PDF</title>
          <style>
            body {
              font-family: Arial, sans-serif;
              line-height: 1.6;
              padding: 40px;
              color: #1e293b;
            }
            h1 {
              text-align: center;
              color: #0f172a;
              margin-bottom: 40px;
            }
            pre {
              white-space: pre-wrap;
              word-wrap: break-word;
              font-size: 1rem;
            }
          </style>
        </head>
        <body>
          <h1>Resume</h1>
          <pre>${resumeText}</pre>
        </body>
      </html>
    `);
    win.document.close();
    win.print();
  };

  return (
    <div style={styles.app}>
      <aside style={styles.sidebar}>
        <h2 style={styles.logo}>ResumeParser</h2>
        <ul style={styles.nav}>
          <li>Upload</li>
          <li>Preview</li>
          <li>Download</li>
        </ul>
      </aside>

      <main style={styles.main}>
        <header style={styles.header}>
          <h1>Resume Dashboard</h1>
          <p>Upload your .txt resume and export as a polished PDF</p>
        </header>

        <section style={styles.uploadSection}>
          <input
            type="file"
            accept=".txt"
            onChange={(e) => handleFile(e.target.files[0])}
            style={styles.fileInput}
          />
          <div
            style={styles.dropzone}
            onDragOver={(e) => e.preventDefault()}
            onDrop={handleDrop}
          >
            Drag & Drop resume here
          </div>
        </section>

        {resumeText && (
          <section style={styles.preview}>
            <h2>Preview</h2>
            <div style={styles.previewBox}>
              <pre>{resumeText}</pre>
            </div>
            <button style={styles.button} onClick={downloadPDF}>
              Download as PDF
            </button>
          </section>
        )}
      </main>
    </div>
  );
}

const styles = {
  app: {
    display: "flex",
    minHeight: "100vh",
    fontFamily: "Arial, sans-serif",
    background: "#f8fafc",
    color: "#0f172a",
  },
  sidebar: {
    width: "220px",
    background: "#0f172a",
    color: "white",
    padding: "2rem 1rem",
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-between",
  },
  logo: { fontSize: "1.5rem", fontWeight: "bold", marginBottom: "2rem" },
  nav: {
    listStyle: "none",
    padding: 0,
    margin: 0,
    display: "flex",
    flexDirection: "column",
    gap: "1rem",
    fontSize: "1rem",
  },
  main: { flex: 1, padding: "2rem" },
  header: { marginBottom: "2rem" },
  uploadSection: { marginBottom: "2rem" },
  fileInput: { display: "block", marginBottom: "1rem" },
  dropzone: {
    border: "2px dashed #64748b",
    borderRadius: "10px",
    padding: "2rem",
    textAlign: "center",
    color: "#64748b",
  },
  preview: { marginTop: "2rem" },
  previewBox: {
    background: "white",
    padding: "1.5rem",
    borderRadius: "10px",
    border: "1px solid #e2e8f0",
    maxHeight: "400px",
    overflowY: "auto",
    marginBottom: "1.5rem",
  },
  button: {
    background: "#0f172a",
    color: "white",
    border: "none",
    padding: "0.8rem 1.5rem",
    borderRadius: "8px",
    cursor: "pointer",
    fontSize: "1rem",
  },
};
